import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

function ShopAll() {
  const [products, setProducts] = useState([]);
  const [originalProducts, setOriginalProducts] = useState([]);

  let handleSearchInput = (e) => {
    e.preventDefault();
    let getValue = e.target.value;
    const filterItems = originalProducts.filter((item) => {
      return item.name.toLowerCase().includes(getValue.toLowerCase());
    });
    if (filterItems.length > 0) {
      setProducts(filterItems);
    } else {
      // If the search input is empty, reset the products list
      setProducts(originalProducts);
    }
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5002/getProductsWithImage');
        const data = response.data;
        console.log('Fetched data:', data);
        setProducts(data);
        setOriginalProducts(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <div className="bg-gray-200">
        <div className="container h-screen flex justify-center items-center px-4 sm:px-6 lg:px-8">
          <div className="relative">
            <input
              type="text"
              className="h-14 w-96 pr-8 pl-5 rounded z-0 focus:shadow focus:outline-none"
              placeholder="Search anything..."
              onChange={handleSearchInput}
            />
            <div className="absolute top-4 right-3">
              <i className="fa fa-search text-gray-400 z-20 hover:text-gray-500" />
            </div>
          </div>
        </div>
      </div>

      <div className="text-center p-10">
        <h1 className="font-bold text-4xl mb-4">All products needed for your car</h1>
        <h1 className="text-3xl">Tailwind CSS</h1>
      </div>

      <section
        id="Projects"
        className="w-fit mx-auto grid grid-cols-1 lg:grid-cols-3 md:grid-cols-2 justify-items-center justify-center gap-y-20 gap-x-14 mt-10 mb-5"
      >
        {products.map((product) => (
          <div key={product["_id"]} className="w-72 h-fit bg-white shadow-md rounded-xl duration-500 hover:scale-105 hover:shadow-xl">
            <Link to={`/products/${product["_id"]}`}>
              <img
                src={product.image[0].imageUrl}
                alt={product.name}
                className="h-80 w-72 object-cover rounded-t-xl"
              />
              <div className="px-4 py-3 w-72">
                <span className="text-gray-400 mr-3 uppercase text-xs">{product.title}</span>
                <p className="text-lg font-bold text-black truncate block capitalize">
                  {product.name}
                </p>
                <div className="flex items-center">
                  <p className="text-lg font-semibold text-black cursor-auto my-3">
                    ${product.price}
                  </p>
                  <del>
                    <p className="text-sm text-gray-600 cursor-auto ml-2">${product.Price}</p>
                  </del>
                  <div className="ml-auto">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width={20}          
                      height={20}
                      fill="currentColor"
                      className="bi bi-bag-plus"
                      viewBox="0 0 16 16"
                    >
                      {/* ... (bag-plus icon paths) */}
                    </svg>
                  </div>
                </div>
              </div>
            </Link>
          </div>
        ))}
      </section>

      <div className="flex items-center justify-center">
        <nav aria-label="Page navigation example">
          <ul className="inline-flex -space-x-px text-sm">
            {/* ... (pagination links) */}
          </ul>
        </nav>
      </div>
    </div>
  );
}

export default ShopAll;
